import * as React from 'react';
import { View, Text} from 'react-native';
import { Button } from 'react-native-web';
import { Entypo } from '@expo/vector-icons';

export default function BreakfastScreen({navigation}) {
    return (
      <View style={{ flex: 1, alignItems:'center', justifyContent:'center' }}>
        <Text>Category</Text>
        <div className="App">
          <input type="text" placeholder="Search Pancake"/>
        </div>
        <Button
          title="Go to Bluebarry Pancake"
          onPress={() => navigation.navigate('Bluebarry Pancake')}
        />
        headerRight: () => (
          <TouchableOpacity style={styles.pontinhos}>
            <Entypo name="dots-two-horizontal" size={20} color="#1D1617" />
          </TouchableOpacity>
        ), 
        <Entypo name="dots-two-horizontal" size={24} color="black" />
      </View>
    );
}
